import React from 'react';
import './home.css';
import * as firebase from 'firebase';


import LoginDone from './logindone';
import Login from './login';


function Logincheck()
{
  var finallog = "aaa";

  firebase.auth().onAuthStateChanged(function(user) {
  if (user) {
    finallog = <LoginDone />;
    alert("logincheck");

  } else {
    finallog = <Login />;

  }
});

  return (
    <div>
    dddddddddddddd
      {finallog}
    </div>
  );


}

export default Logincheck;
